import React from "react";

export default function FreelancerDetail() {
  return (
    <div style={{ backgroundColor: "#171717", width: "100vw" }}>
      <div className="details-top">
        <div className="freelancer-name">
          <h4>Hi , I am</h4>
          <h4>Askarov Razak</h4>
        </div>
      </div>
    </div>
  );
}
